import React from "react";
import './Home.css';
import Header from "../Header/Header";
import { useNavigate } from "react-router-dom";

function AddAdress(){
    const naigate=useNavigate();
    function add(){
        naigate('/home/address')
    }
    return(
        <div>
            <div>
                {/* <Header/> */}
            </div>
            <div id="addaddress">
            <div id="cart_container1">
            <img id="cart_img"src={require("../assets/Images/address.png")} alt="a" /><h1>Choose a Delivery Address</h1>
                <div id="new_address">
                    <h4 onClick={add}>Add new address</h4>
                </div>

            </div>
            <div id="cart_container">
            <img id="cart_img"src={require("../assets/Images/payment.png")} alt="a" /><h1>Payment</h1>  
            </div>
            </div>
        </div>
    )
}
export default AddAdress
